interface ActorsInt{
    id: number | undefined;
    name: string;
    image: string;
    description: string;
}

export default class Actors implements ActorsInt{
    constructor(
        public id: number | undefined,
        public name: string,
        public image: string,
        public description: string,
    ){}
}
